eur</h2><p style=\"text-align: center;\"><br></p><p style=\"text-align: center;\">DecoDoors maakt houten binnendeuren die passen bij jouw stijl en ruimte. Elk ontwerp wordt met zorg op maat </p><p style=\"text-align: center;\">gemaakt in onze eigen werkplaats. Van modern tot klassiek: jij kiest, wij maken het waar  met oog voor detail en </p><p style=\"text-align: center;\">hoogwaardige afwerking.</p></div><div class=\'edit-block\' onclick=\'editBlock(this)\' id=\'edit-block-xlgq4\'><i  class=\'edit-block-icon bx bx-edit\'></i></div><div class=\'cancel-block\' onclick=\'removeblock(this)\' id=\'edit-block-xlgq4\'><i  class=\'remove-block-icon bx bx-trash\'></i></div></div></div></div><div class=\"delete-columns-row\" id=\"nnme9\" onclick=\"deleteColumn(this)\"><i class=\"delete-columns-row-icon bx bx-trash\"></i></div><div class=\"edit-parent-column\" id=\"nnme9\" onclick=\"editColumnRow(this)\"><i class=\"edit-column-row-icon bx bx-edit\"></i></div><div class=\'sortable-handle\' wire:sortable.handle><i class=\'edit-column-row-icon bx bx-move\'></i></div></div>',0,'nnme9',1,'2025-05-01 11:44:07','2025-05-01 11:44:07'),(917,'<div class=\"full-width-box\" wire:sortable.item=\"wrcxo\" wire:key=\"wrcxo\" id=\"full-width-box-wrcxo\" style=\"background-color: rgb(247, 245, 243); max-width: 100%; margin: 22px 0px 50px;\"> <div class=\"container row-container\" id=\"container-wrcxo\" style=\"padding: 0px; max-width: 1320px;\"><div id=\'owhtb\' class=\'four-columns-row row added-block-row\'><div class=\"col-12 col-md-6 col-lg-3 added-column added-column-4\" style=\"undefined\" id=\"30jw8\"><div class=\'edit-columns-row\' onclick=\'editColumn(this)\'><i class=\'edit-columns-row-icon bx bx-edit\'></i></div><div class=\"block-texteditor block-value\" style=\"background-color: rgb(255, 255, 255); padding: 25px; margin: 0px 0px 25px; display: block;\"  id=\"block-30jw8\"><p><img src=\"data:image/png;base64,\" style=\"width: 38px; height: 38px;\" data-filename=\"opmaat.png\"></p><p><br></p><h4 class=\"\">Volledig op maat</h4><p>Van afmetingen tot afwerking  alles wordt afgestemd op&nbsp;</p><p>jouw wensen.</p><p><br></p><p><br></p></div><div class=\'edit-block\' onclick=\'editBlock(this)\' id=\'edit-block-30jw8\'><i  class=\'edit-block-icon bx bx-edit\'></i></div><div class=\'cancel-block\' onclick=\'removeblock(this)\' id=\'edit-block-30jw8\'><i  class=\'remove-block-icon bx bx-trash\'></i></div></div><div class=\"col-12 col-md-6 col-lg-3 added-column added-column-4\" style=\"undefined\" id=\"5zq9m\"><div class=\'edit-columns-row\' onclick=\'editColumn(this)\'><i class=\'edit-columns-row-icon bx bx-edit\'></i></div><div class=\"block-texteditor block-value\" style=\"background-color: rgb(255, 255, 255); padding: 25px; margin: 0px 0px 25px; display: block;\"  id=\"block-5zq9m\"><p><img src=\"data:image/png;base64,\" style=\"width: 38px; height: 38px;\" data-filename=\"snel-geleverd.png\"><br></p><p><br></p><h4 class=\"\" style=\"color: rgb(0, 0, 0);\">Snel geleverd</h4><p>Strak gepland en vakkundig gemonteerd door ons eigen team.</p><p><br></p><p><br></p><p><br></p></div><div class=\'edit-block\' onclick=\'editBlock(this)\' id=\'edit-block-5zq9m\'><i  class=\'edit-block-icon bx bx-edit\'></i></div><div class=\'cancel-block\' onclick=\'removeblock(this)\' id=\'edit-block-5zq9m\'><i  class=\'remove-block-icon bx bx-trash\'></i></div></div><div class=\"col-12 col-md-6 col-lg-3 added-column added-column-4\" style=\"undefined\" id=\"n7m6z\"><div class=\'edit-columns-row\' onclick=\'editColumn(this)\'><i class=\'edit-columns-row-icon bx bx-edit\'></i></div><div class=\"block-texteditor block-value\" style=\"background-color: rgb(255, 255, 255); padding: 25px; margin: 0px 0px 25px; display: block;\"  id=\"block-n7m6z\"><p><img src=\"data:image/png;base64,\" style=\"width: 38px; height: 38px;\" data-filename=\"hoogwaardige-afwerking.png\"><br></p><p><br></p><h4 class=\"\" style=\"color: rgb(0, 0, 0);\">Hoogwaardige afwerking</h4><p>We gebruiken alle